import React from 'react';

const Category = () => {
  return (
    <nav className="navbar navbar-expand-md sticky-top py-3 navbar-dark" id="mainNav">
      <div className="container">
        {/* Toggle button is always visible */}
        <button 
          className="navbar-toggler" 
          type="button" 
          data-bs-toggle="collapse" 
          data-bs-target="#navcol-1"
          aria-controls="navcol-1"
          aria-expanded="true" 
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        
        {/* Navbar items with "show" class to make them always visible */}
        <div className="collapse navbar-collapse show" id="navcol-1">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><a className="nav-link" href="">All</a></li>
            <li className="nav-item"><a className="nav-link" href="">Food</a></li>
            <li className="nav-item"><a className="nav-link" href="">Drink</a></li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Category;
